import Card from 'react-bootstrap/Card';
import FruitCard from '../../Common/Card/fruitCard';

function Cart({cart}) {
    return (
        <Card>
            <div style={{display:'flex',flexDirection: 'row'}}>
            {
                Object.values(cart).length > 0 &&
                    Object.values(cart).map((list, key)=>{
                        return (
                           <FruitCard 
                                id={key}
                                name={list.name}
                                image={list.image}
                           />
                        )
                    })
            }
            </div>
        </Card>
    );
}

export default Cart;
